// src/pages/RideOptions.tsx
import React from 'react';
import Map from '../components/Map.tsx';  // Importando o componente Map

const RideOptions: React.FC = () => {
  const route = {
    start: [51.505, -0.09],  // Coordenadas de exemplo para origem
    end: [51.515, -0.1],     // Coordenadas de exemplo para destino
    path: [
      [51.505, -0.09],
      [51.515, -0.1]
    ]
  };

  return (
    <div>
      <h1>Opções de Viagem</h1>
      {/* Passando a route como prop para o Map */}
      <Map route={route} />
    </div>
  );
};

export default RideOptions;
